import React from 'react';
import './App.css';
import Input from './components/Input';

const todoList=[{
  name: 'ajsdias',
  done: true,
  id:121
},
{
  name: 'asdas',
  done: false,
  id:5788
}
];

function App() {
  return (
    <div className="App">
      <div className="app_container">
          <div className="app_todoContainer">
              {/* {todoList.map(item =>(
                <p>{item.name} </p>)
              )} */}
              {todoList.map((item) =>
                <li>
                  {item.name}
                </li>
              )}
          </div>
            <Input />
      </div>
    </div>
  );
}

export default App;
